import React, { Component } from 'react';
import '../../css/Home.css';

class StandingEntry extends Component {

    render() {
        return (
            <tr className="rightalign">
                <td>{this.props.name}</td>
                <td>{this.props.wins}</td>
                <td>{this.props.losses}</td>
            </tr>
        )
    }
}

export default StandingEntry;
